CREATE TABLE django_GM.tb_bills
(
    GameOrderId bigint(20) PRIMARY KEY NOT NULL COMMENT '游戏订单号' AUTO_INCREMENT,
    GiftId varchar(32) NOT NULL COMMENT '礼包ID',
    ProductType char(1) NOT NULL COMMENT '商品类型 (1:正常充值, 2:充值礼包, 3:月卡充值, 4:联盟礼包)',
    ProductId varchar(32) NOT NULL COMMENT '商品ID',
    OtherArg int(11) NOT NULL COMMENT '自定义项, 如果是联盟礼包, 是否是匿名购买',
    PriceCurrencyCode char(3) NOT NULL COMMENT '货币代码 (如: CNY、GBP, 标准: https://en.wikipedia.org/wiki/ISO_4217#Active_codes)',
    PriceAmount decimal(10,2) NOT NULL COMMENT '当地价格',
    Uid bigint(20) NOT NULL COMMENT '用户ID',
    ZoneId int(11) NOT NULL COMMENT '分区号',
    Os tinyint(4) NOT NULL COMMENT '操作系统',
    AccountType tinyint(4) NOT NULL COMMENT '账号类型 (1:试玩玩家, 2:Facebook, 3:Google)',
    AccountId varchar(32) NOT NULL COMMENT '账号ID (如: FacebookId)',
    RegisterTime int(11) NOT NULL COMMENT '用户注册时间 (秒级时间戳)',
    Nickname varchar(100) NOT NULL COMMENT '用户昵称',
    ClientIP varchar(50) NOT NULL COMMENT '客户端IP',
    CountryCode char(2) NOT NULL COMMENT '国家代码 (如: CN、US, 标准: https://en.wikipedia.org/wiki/ISO_3166-1)',
    PurchaseTimes int(11) NOT NULL COMMENT '充值次数',
    PurchasePlatform tinyint(4) NOT NULL COMMENT '支付平台 (1:GooglePlayer)',
    OrderId varchar(50) NOT NULL COMMENT '平台订单号',
    PurchaseToken varchar(120) NOT NULL COMMENT '平台订单Token',
    PurchaseState tinyint(4) NOT NULL COMMENT '购买状态 (-1:已创建, 0:成功, 1:已取消, 2:已退款, 3:非法)',
    CancelReason varchar(10) COMMENT '取消原因 (311:正常取消, 其他编号为异常, 详见客户端代码)',
    CreateTime int(11) NOT NULL COMMENT '创建时间 (秒级时间戳',
    PurchaseTime int(11) NOT NULL COMMENT '购买时间 (0: 未购买)',
    DeliverTime int(11) NOT NULL COMMENT '发货时间 (0: 未发货)',
    InAccountTime int(11) NOT NULL COMMENT '到账时间 (0: 未到账)'
);
CREATE INDEX simple_createtime ON django_GM.tb_bills (CreateTime);
